import { createGlobalStyle } from 'styled-components';

import ThemifyTTF from './themify.ttf';
import ThemifyWOFF from './themify.woff';

export default createGlobalStyle`
    @font-face {
        font-family: 'Themify';
        src: local('ThemifyTTF'), local('ThemifyWOFF'),
        url(${ThemifyTTF}) format('ttf'),
        url(${ThemifyWOFF}) format('woff');
        font-weight: 300;
        font-style: normal;
    }
`;
